import React from "react";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { getTemperaments } from "../../redux/actions/actions";

const Temperaments = () => {

    const state = useSelector( state => state.temperaments);
    const dispatch = useDispatch();
    
    useEffect(()=>{
        dispatch(getTemperaments());
    }, [dispatch]);



  return (
    <div>
      <label htmlFor="temperaments">Choose temperaments</label>
      <select name="temperaments" id="">
          {state.map(t=>{
              <option value=""></option>
          })}
      </select>
    </div>
  );
};
export default Temperaments;
